import React from 'react';
import Pokemon from './Pokemon';

class Pokedex extends React.Component {
  render(){
    const { pokemons } = this.props;

    return (
          pokemons.map((currentPokemon) => (
          <Pokemon key={currentPokemon.id} pokemon={currentPokemon} />
        )) 
    );
  }
};

